<script type="application/shiny-prerendered" data-context="server-start">
## Cargar paquetes
pacman::p_load(
  # Interactividad
  shiny,
  shinyWidgets,
  # Mapas
  sf,
  geoAr,
  leaflet,
  # Gráficos
  cols4all,
  BAMMtools,
  apyramid,
  # Tablas
  DT,
  # Manejo de datos
  rio,
  janitor,
  tidyverse
)

## Cargar configuración de idioma para las tablas
source("data_table_es.R")

## Cargar dataset
datos <- import("datos_sivile_2024.csv") |>
  mutate(across(
    .cols = where(is.character) | codigo_institucion_id,
    .fns = ~ factor(.x)
  ))
</script>
 
<script type="application/shiny-prerendered" data-context="server">
## Datos para la tabla
datos_prov <- datos |>
  select(
    Provincia = prov_lesion,
    Sexo = sexo,
    Edad = grupo_edad,
    Intencionalidad = intencionalidad_cat
  )


## Tabla interactiva
output$tab_prov <- renderDT({
  req(datos_prov)

  # Definir estratos: por defecto mostrar Provincia
  estratos <- input$vars
  if (is.null(estratos) || length(estratos) == 0) {
    estratos <- NULL
  }

  # Construir tabla
  tabla <- datos_prov |>
    count(Provincia, across(all_of(estratos)), name = "Frecuencia") |>
    mutate(
      "%" = scales::percent(
        Frecuencia / sum(Frecuencia, na.rm = TRUE),
        accuracy = 0.01
      ),
      .by = Provincia
    ) |>
    arrange(-Frecuencia)

  # Si solo hay Provincia, agregar fila de totales
  if (is.null(estratos)) {
    tabla <- datos_prov |>
      count(Provincia, name = "Frecuencia") |>
      mutate(
        "%" = scales::percent(
          Frecuencia / sum(Frecuencia, na.rm = TRUE),
          accuracy = 0.01
        )
      ) |>
      arrange(-Frecuencia)
  }

  # Mostrar DT
  datatable(
    tabla,
    options = list(
      autoWidth = TRUE,
      searching = FALSE,
      language = dt_lang_es
    ),
    rownames = FALSE,
    selection = "single"
  )
})
</script>
 
<script type="application/shiny-prerendered" data-context="server">
## Datos para el gráfico
datos_plot <- datos |>
  # Seleccionar variables
  select(
    Sexo = sexo,
    Edad = grupo_edad,
    Educación = nivel_instruccion_cat,
    Empleo = sit_laboral_cat,
    Mecanismo = mecanismo_cat,
    Intencionalidad = intencionalidad_cat,
    Egreso = egreso_cat
  ) |>

  # Recategorizar niveles
  mutate(
    Educación = fct_relevel(Educación, "Desconocido", after = Inf),
    Empleo = fct_relevel(Empleo, "Otra/Desconocida", after = Inf),
    Mecanismo = fct_relevel(Mecanismo, "Otro", after = Inf),
    Intencionalidad = fct_relevel(
      Intencionalidad,
      "Otra/desconocida",
      after = Inf
    ),
    Egreso = fct_relevel(Egreso, "Desconocido", after = Inf)
  )


# Actualizar selectInput dinámicamente
observe({
  vars <- names(datos_plot)
  updateSelectInput(session, "var", choices = vars, selected = "Edad")
  updateSelectInput(session, "estrato", choices = vars, selected = NULL)
})

# Renderizar gráfico
output$pyramid_plot <- renderPlot({
  req(input$var, input$estrato)

  age_pyramid(
    data = datos_plot,
    age = input$var,
    split = input$estrato
  ) +
    scale_fill_discrete_c4a_cat(palette = input$palette) +
    theme_minimal()
})
</script>
 
<script type="application/shiny-prerendered" data-context="server-extras">
ojs_define <- function(..., .session = shiny::getDefaultReactiveDomain()) {
  quos <- rlang::enquos(...)
  vars <- rlang::list2(...)
  nm <- names(vars)
  if (is.null(nm)) {
    nm <- rep_len("", length(vars))
  }
  mapply(
    function(q, nm, val) {
      # Infer name, if possible
      if (nm == "") {
        tryCatch(
          {
            nm <- rlang::as_name(q)
          },
          error = function(e) {
            code <- paste(collapse = "\n", deparse(rlang::f_rhs(q)))
            stop(
              "ojs_define() could not create a name for the argument: ",
              code
            )
          }
        )
      }
      .session$output[[nm]] <- val
      outputOptions(.session$output, nm, suspendWhenHidden = FALSE)
      .session$sendCustomMessage("ojs-export", list(name = nm))
      NULL
    },
    quos,
    nm,
    vars,
    SIMPLIFY = FALSE,
    USE.NAMES = FALSE
  )
  invisible()
}
</script>

            }
          });
        }
    const findCites = (el) => {
      const parentEl = el.parentElement;
      if (parentEl) {
        const cites = parentEl.dataset.cites;
        if (cites) {
          return {
            el,
            cites: cites.split(' ')
          };
        } else {
          return findCites(el.parentElement)
        }
      } else {
        return undefined;
      }
    };
    var bibliorefs = window.document.querySelectorAll('a[role="doc-biblioref"]');
    for (var i=0; i<bibliorefs.length; i++) {
      const ref = bibliorefs[i];
      const citeInfo = findCites(ref);
      if (citeInfo) {
        tippyHover(citeInfo.el, function() {
          var popup = window.document.createElement('div');
          citeInfo.cites.forEach(function(cite) {
            var citeDiv = window.document.createElement('div');
            citeDiv.classList.add('hanging-indent');
            citeDiv.classList.add('csl-entry');
            var biblioDiv = window.document.getElementById('ref-' + cite);
            if (biblioDiv) {
              citeDiv.innerHTML = biblioDiv.innerHTML;
            }
            popup.appendChild(citeDiv);
          });
          return popup.innerHTML;
        });
      }
    }
  });
  </script>
</div> <!-- /container fluid -->

<script type="application/javascript">
window.document.addEventListener("DOMContentLoaded", function (_event) {
  if (window.bslib.Card) {
    window.bslib.Card.initializeAllCards();
  }
}); 
</script>
